import React from 'react'
import Header from "../users/Header";
import {
  CCard,
  CCardBody
} from "@coreui/react";

const HelloWorld = (props) => {

  return (
    <>
      <Header state={props.state}/>
      <CCard>
        <CCardBody>
          <h1>Hello, world!</h1>
        </CCardBody>
      </CCard>
    </>
  )
}

export default HelloWorld;
